function collectGithubFiles(dirName, fileNames) {
    if(hasSubfolders[dirName]) {
        let folders = {}
        fileNames.filter(fileName => isTest(`${__dirname}/github/${dirName}/${fileName}`)).forEach(testFileName => folders[testFileName.split('/')[0]] = true)
        let outputFiles = []
        for(folder in folders) {
            let folderFileNames = fileNames.filter(fileName => fileName.startsWith(folder + '/')).map(fileName => fileName.substr(folder.length + 1))
            if(folderFileNames.length) outputFiles.push(collectGithubFiles(`${dirName}/${folder}`, folderFileNames))
        }
        return outputFiles
    }
    if(skipDir[dirName]) return []
    if(onlyDir && dirName !== onlyDir) return []
    if(!includePlayground[dirName]) fileNames = fileNames.filter(fileName => !fileName.includes('.playground/'))
    fileNames = fileNames.map(fileName => `${__dirname}/github/${dirName}/${fileName}`)
    if(includeAdditionalFiles[dirName]) fileNames = [...includeAdditionalFiles[dirName], ...fileNames]
    fileNames = fileNames.sort((fileName0, fileName1) => {
        if(fileOrder[dirName])
            if(fileOrder[dirName].includes(fileName0))
                if(fileOrder[dirName].includes(fileName1)) return fileOrder[dirName].indexOf(fileName0) < fileOrder[dirName].indexOf(fileName1) ? -1 : 1
                else return -1
            else if(fileOrder[dirName].includes(fileName1)) return 1
        const isTest0 = isTest(fileName0), isTest1 = isTest(fileName1)
        return isTest0 === isTest1 ? 0 : isTest0 ? 1 : -1
    })
    //console.log(dirName, fileNames)
    let contents = ''
    for(const fileName of fileNames) {
        contents +=
            fs.readFileSync(fileName).toString('utf8').
            replace(/(?:@testable\s+)?import\s+(\S+)/g, (cmd, moduleName) => moduleName in moduleFiles ? cmd : "")
            + '\n\n'
    }
    let testInstances = contents.match(/[\S]+[\s]*\:[\s]*XCTestCase/g)
    if(testInstances) for(const testInstance of testInstances) {
        contents += "\n" + testInstance.split(":")[0] + "()"
    }
    fs.writeFileSync(`${__dirname}/github/${dirName}/concat.swift`, contents)
    return [`${dirName}/concat.swift`]
}

